import React, {
  Component
} from 'react'
import {
  connect
} from 'react-redux';
import * as actions from '../redux/actions';

class SoundBar extends Component {

  render() {
    const divStyle = {
      position: 'absolute',
      width: '150px',
      height: '100vh',
      right: '0',
      top: '10',
      backgroundColor: '#EEEEEE',
      borderRight: '1px dotted'
    }
    return ( <
      div className = "droppable"
      onDragOver = {
        (e) => this.onDragOver(e)
      }
      onDrop = {
        (e) => this.onDrop(e, "complete")
      } >
      <
      span className = "task-header" > COMPLETED < /span> {
        tasks.complete
      } <
      /div>
    )
  }
}

function mapStateToProps(state) {
  return {
    // animalSrc: state.animal.animalSrc,
    // isLoading: state.animal.isLoading,
  }
}

export default connect(mapStateToProps, actions)(SoundBar);
